    return (
        <Routes>
            <Route path="/" element={<Intro />} />
            <Route path="destinations" element={<Destination />} />
            <Route path="crew" element={<Crew />} />
            {/* <Route path="technology" element={<Technology />} /> */}
            {/* <Route path="tech" element={<Circle />} /> */}
        </Routes>
    );
}

export default Sections;
